24 electronic dance tracks in the MP3 format, sorted into two albums by Swedish music producer Andreas Viklund, former member of the filesharing-friendly band Lagoona. These tracks are also free to share to anyone who may want them. Proper tags and covers are included. Go share it!

This torrent is uploaded with full permission from the artist. If you like what you hear, send a friendly note to the artist through his website: 
 &lt;a href=&quot;
http://andreasviklund.com/&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://andreasviklund.com/&lt;/a&gt;

Albums included: *eXtended Modules collection* (16 songs) and *Free music collection* (8 songs) 

